import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for price filter to be visible
    await page.waitForSelector('.price-filter', { timeout: 5000 });

    // Fill in price range inputs
    await page.fill('#minPrice', '50');
    await page.fill('#maxPrice', '200');

    // Take screenshot after filling prices
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_filled.png'));

    // Click apply filter button
    await page.click('.apply-filter');

    // Wait for results to update
    await page.waitForTimeout(1000);

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract results information
    const resultsCount = await page.$eval('.results-count', el => el.textContent);
    const productCards = await page.$$('.product-card, .product-card-list');

    return {
      success: true,
      action: "Applied price range filter ($50-$200) successfully",
      extractedData: {
        resultsCount: resultsCount,
        productCount: productCards.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
